function MythicPlusHonorData:GetRating(name, realm)
    if not name or not realm then return nil end
    
    -- Normalize realm name (remove spaces)
    realm = realm:gsub("%s+", "")
    local key = name .. "-" .. realm
    
    if self.ratings[key] then
        local data = self.ratings[key]
        return {
            averageRating = data[1],
            totalRatings = data[2],
            lastRating = data[3]
        }
    end
    
    return nil
end

function MythicPlusHonorData:GetStats()
    return {
        version = self.version,
        lastUpdate = self.lastUpdate,
        dataDate = self.dataDate,
        totalPlayers = self.totalPlayers,
        totalRatings = self.totalRatings
    }
end
